    public int NumberOfGoodSubarraySplits_MEMORYFULL(int[] nums) {
        for (int i = nums.Length - 1; i>=0; i--)
        {
            int result = 1;
            if (nums[i] == 1)
            {
                int NumberOfZeroes = 0;
                for (int j = i-1; j >= 0; j--)
                {
                    if (nums[j] == 1)
                    {
                        NumberOfZeroes = i - j - 1;
                        result = NumberOfGoodSubarraySplits(nums[..(j+1)]);

                        // Console.WriteLine(result);
                        // for (int m = 0; m < nums.Length; m++)
                        // {
                        //     Console.Write(nums[m]+" ");
                        // }
                        // Console.WriteLine("");
                        //
                        // Console.WriteLine("==========");
                        break;
                    }
                }

                long fin;
                fin = (long)result * ((long)NumberOfZeroes + (long)1);
                fin %= 1000000007;
                return Convert.ToInt32(fin);
            }
        }
        return 0;
    }

    public int NumberOfGoodSubarraySplits(int[] nums)
    {
        int ZeroCount = 1;
        int i = 0;
        bool OneDetected = false;
        while (i<nums.Length && nums[i] != 1)
        {
            i++;
        }

        long final = 1;
        for (; i < nums.Length; i++)
        {
            if (nums[i] == 1)
            {
                OneDetected = true;
                final = final * (long)ZeroCount;
                final = final % 1000000007;
                Console.WriteLine(final);
                ZeroCount = 0;
            }

            ZeroCount = ZeroCount + 1;
        }

        return OneDetected ? Convert.ToInt32(final) : 0;
    }

